// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21 <0.7.0;

contract Kyc {
  address public admin;
  struct Customer {
      uint uname;
      string name;
      string location;
      address organization;
      bool kycStatus;
  }

  struct Organization {
      string name;
      address ethAddress;
  }

  struct kycRequest{
      address ethAddress;
      uint uname;
      bool isAllowed;
  }

  constructor() public {
      admin = msg.sender;
  }

  mapping(uint => Customer) customers;
  mapping(address => Organization) organizations;
  mapping(uint => kycRequest) kycrequests;

// Checks whether the requestor is admin
  modifier isAdmin {
      require(
          admin == msg.sender,
          "Only admin are allowed"
      );
      _;
  }

  modifier isOrgValid {
      require(
          organizations[msg.sender].ethAddress == msg.sender,
          "Unauthenticated organization | Not added by admin"    
      );
      _;
  }

  function addOrg(string memory _name,address _ethAddress) public isAdmin returns(bool) {
      require(organizations[_ethAddress].ethAddress!=_ethAddress,"Org already added");
      organizations[_ethAddress]=Organization(_name,_ethAddress);
  }
  
  function viewOrg(address _ethAddress)public isAdmin view returns(string memory){
      return(organizations[_ethAddress].name);
  }
  function registerKYC(uint _uname , string memory _name, string memory _location,bool _kycStatus) public isOrgValid returns(bool){
      require(customers[_uname].uname!=_uname,"User already exists");
      customers[_uname]=Customer(_uname,_name,_location,msg.sender,_kycStatus);
  }
  
  function viewKYC(uint _uname, address _ethAddress) public view returns(uint,string memory,string memory,bool){
      require(kycrequests[_uname].uname==_uname && kycrequests[_uname].ethAddress==_ethAddress && kycrequests[_uname].isAllowed==true,"User hasnt given their consent");
      return(customers[_uname].uname,customers[_uname].name,customers[_uname].location,customers[_uname].kycStatus);
  }
  function updateKYC(uint _uname , string memory _name, string memory _location,bool _kycStatus) public isOrgValid returns(bool){
      require(customers[_uname].uname==_uname,"User doesn't exist");
      customers[_uname]=Customer(_uname,_name,_location,msg.sender,_kycStatus);
  }
  
  function requestKYC(uint _uname) public isOrgValid{
      require(customers[_uname].uname==_uname,"Customer doesnt exists");
      kycrequests[_uname] = kycRequest(msg.sender,_uname,false);
  }

  function giveAccessKYC(uint _uname,address _ethAddress,bool _isAllowed) public isOrgValid returns(bool){
      require(kycrequests[_uname].uname==_uname && kycrequests[_uname].ethAddress==_ethAddress,"Requests not found");
      if(kycrequests[_uname].uname==_uname && kycrequests[_uname].ethAddress==_ethAddress){
          kycrequests[_uname].isAllowed = _isAllowed;
      }
  }
}
